import React , {useContext, useEffect, useState} from "react";
import Card from "../components/Card"
import {CoinListContext} from "../context/coinListContext"
//Globals URLS
const url = "https://api.coincap.io/v2";
const webUrl = "wss://ws.coincap.io/prices?assets="

function CoinLandingPage() {
    const [coins,setCoins] = useState([]);

    const {coinList} = useContext(CoinListContext);
    return(<div>
            {coinList.map( coin => {
                return <Card webUrl={webUrl} crypto={coin.id} image={coin.image} percentChange={coin.price_change_percentage_24h}/>
            })}
    </div>);
}

export default CoinLandingPage;
